import React, { Component } from "react";
import WelcomeMessage from "./WelcomeMessage";
import "./Landing.css";

class Landing extends Component {
  state = {};
  render() {
    return (
      <div class="jumbotron">
        <WelcomeMessage />
      </div>
    );
  }
}

export default Landing;
